import React from "react";

import tacOps from "../assets/tac-ops-cards.json";
import { TacOpsCard } from "../components/tac-ops-card";
import { TacOpsList } from "../components/tac-ops-list";
import { useViewedCard } from "../context/view-card-context";

export function Browse() {
  const { viewedCard } = useViewedCard();
  return (
    <div>
      {viewedCard ? (
        <TacOpsCard cardInfo={viewedCard} />
      ) : (
        <TacOpsList data={tacOps} />
      )}
    </div>
  );
}
